("G9873", "1801897038", "", "First Medicare Diabetes Prevention Program (MDPP) core session was attended by an MDPP beneficiary under the MDPP Expanded Model (EM). A core session is an MDPP service that: (1) is furnished by an MDPP supplier during months 1 through 6 of the MDPP services period; (2) is approximately 1 hour in length; and (3) adheres to a CDC-approved DPP curriculum for core sessions"),
("G9874", "1801897038", "", "Four total Medicare Diabetes Prevention Program (MDPP) core sessions were attended by an MDPP beneficiary under the MDPP Expanded Model (EM). A core session is an MDPP service that: (1) is furnished by an MDPP supplier during months 1 through 6 of the MDPP services period; (2) is approximately 1 hour in length; and (3) adheres to a CDC-approved DPP curriculum for core sessions"),
("G9875", "1801897038", "", "Nine total Medicare Diabetes Prevention Program (MDPP) core sessions were attended by an MDPP beneficiary under the MDPP Expanded Model (EM). A core session is an MDPP service that: (1) is furnished by an MDPP supplier during months 1 through 6 of the MDPP services period; (2) is approximately 1 hour in length; and (3) adheres to a CDC-approved DPP curriculum for core sessions"),
("G9876", "1801897038", "", "Two Medicare Diabetes Prevention Program (MDPP) core maintenance sessions (MS) were attended by an MDPP beneficiary in months (mo) 7-9 under the MDPP Expanded Model (EM). A core maintenance session is an MDPP service that: (1) is furnished by an MDPP supplier during months 7 through 12 of the MDPP services period; (2) is approximately 1 hour in length; and (3) adheres to a CDC-approved DPP curriculum for maintenance sessions. The beneficiary did not achieve at least 5% weight loss (WL) from his/her baseline weight, as measured by at least one in-person weight measurement at a core maintenance session in months 7-9"),
("G9877", "1801897038", "", "Two Medicare Diabetes Prevention Program (MDPP) core maintenance sessions (MS) were attended by an MDPP beneficiary in months (mo) 10-12 under the MDPP Expanded Model (EM). A core maintenance session is an MDPP service that: (1) is furnished by an MDPP supplier during months 7 through 12 of the MDPP services period; (2) is approximately 1 hour in length; and (3) adheres to a CDC-approved DPP curriculum for maintenance sessions. The beneficiary did not achieve at least 5% weight loss (WL) from his/her baseline weight, as measured by at least one in-person weight measurement at a core maintenance session in months 10-12"),
("G9878", "1801897038", "", "Two Medicare Diabetes Prevention Program (MDPP) core maintenance sessions (MS) were attended by an MDPP beneficiary in months (mo) 7-9 under the MDPP Expanded Model (EM). A core maintenance session is an MDPP service that: (1) is furnished by an MDPP supplier during months 7 through 12 of the MDPP services period; (2) is approximately 1 hour in length; and (3) adheres to a CDC-approved DPP curriculum for maintenance sessions. The beneficiary achieved at least 5% weight loss (WL) from his/her baseline weight, as measured by at least one in-person weight measurement at a core maintenance session in months 7-9"),
("G9879", "1801897038", "", "Two Medicare Diabetes Prevention Program (MDPP) core maintenance sessions (MS) were attended by an MDPP beneficiary in months (mo) 10-12 under the MDPP Expanded Model (EM). A core maintenance session is an MDPP service that: (1) is furnished by an MDPP supplier during months 7 through 12 of the MDPP services period; (2) is approximately 1 hour in length; and (3) adheres to a CDC-approved DPP curriculum for maintenance sessions. The beneficiary achieved at least 5% weight loss (WL) from his/her baseline weight, as measured by at least one in-person weight measurement at a core maintenance session in months 10-12"),
("G9880", "1801897038", "", "The MDPP beneficiary achieved at least 5% weight loss (WL) from his/her baseline weight in months 1-12 of the MDPP services period under the MDPP Expanded Model (EM). This is a one-time payment available when a beneficiary first achieves at least 5% weight loss from baseline as measured by an in-person weight measurement at a core session or core maintenance session"),
("G9881", "1801897038", "", "The MDPP beneficiary achieved at least 9% weight loss (WL) from his/her baseline weight in months 1-24 under the MDPP Expanded Model (EM). This is a one-time payment available when a beneficiary first achieves at least 9% weight loss from baseline as measured by an in-person weight measurement at a core session, core maintenance session, or ongoing maintenance session"),
("G9882", "1801897038", "", "Two Medicare Diabetes Prevention Program (MDPP) ongoing maintenance sessions (MS) were attended by an MDPP beneficiary in months (mo) 13-15 under the MDPP Expanded Model (EM). An ongoing maintenance session is an MDPP service that: (1) is furnished by an MDPP supplier during months 13 through 24 of the MDPP services period; (2) is approximately 1 hour in length; and (3) adheres to a CDC-approved DPP curriculum for maintenance sessions. The beneficiary maintained at least 5% weight loss (WL) from his/her baseline weight, as measured by at least one in-person weight measurement at an ongoing maintenance session in months 13-15"),
("G9883", "1801897038", "", "Two Medicare Diabetes Prevention Program (MDPP) ongoing maintenance sessions (MS) were attended by an MDPP beneficiary in months (mo) 16-18 under the MDPP Expanded Model (EM). An ongoing maintenance session is an MDPP service that: (1) is furnished by an MDPP supplier during months 13 through 24 of the MDPP services period; (2) is approximately 1 hour in length; and (3) adheres to a CDC-approved DPP curriculum for maintenance sessions. The beneficiary maintained at least 5% weight loss (WL) from his/her baseline weight, as measured by at least one in-person weight measurement at an ongoing maintenance session in months 16-18"),
("G9884", "1801897038", "", "Two Medicare Diabetes Prevention Program (MDPP) ongoing maintenance sessions (MS) were attended by an MDPP beneficiary in months (mo) 19-21 under the MDPP Expanded Model (EM). An ongoing maintenance session is an MDPP service that: (1) is furnished by an MDPP supplier during months 13 through 24 of the MDPP services period; (2) is approximately 1 hour in length; and (3) adheres to a CDC-approved DPP curriculum for maintenance sessions. The beneficiary maintained at least 5% weight loss (WL) from his/her baseline weight, as measured by at least one in-person weight measurement at an ongoing maintenance session in months 19-21"),
("G9885", "1801897038", "", "Two Medicare Diabetes Prevention Program (MDPP) ongoing maintenance sessions (MS) were attended by an MDPP beneficiary in months (mo) 22-24 under the MDPP Expanded Model (EM). An ongoing maintenance session is an MDPP service that: (1) is furnished by an MDPP supplier during months 13 through 24 of the MDPP services period; (2) is approximately 1 hour in length; and (3) adheres to a CDC-approved DPP curriculum for maintenance sessions. The beneficiary maintained at least 5% weight loss (WL) from his/her baseline weight, as measured by at least one in-person weight measurement at an ongoing maintenance session in months 22-24"),
("G9890", "1801897038", "", "Bridge Payment: A one-time payment for the first Medicare Diabetes Prevention Program (MDPP) core session, core maintenance session, or ongoing maintenance session furnished by an MDPP supplier to an MDPP beneficiary during months 1-24 of the MDPP Expanded Model (EM) who has previously received MDPP services from a different MDPP supplier under the MDPP Expanded Model.  A supplier may only receive one bridge payment per MDPP beneficiary"),
